INSERT INTO `diseases` VALUES (1,'Number_yaws','Yaws','Yaws — хронічна бактеріальна інфекція (Treponema pallidum pertenue). Типові симптоми: безболісні шкірні виразки («м’ясисті» папули), пізніше – ураження кісток і хрящів, деформації кінцівок.'),(2,'polio_cases','Poliomyelitis','Поліомієліт — вірусне захворювання (Enterovirus). Часто безсимптомний; можливі лихоманка, біль у горлі, м’язова слабкість. У ≈1 % випадків розвивається гострий в’ялий параліч.'),(3,'cases_guinea_worm','Guinea-worm disease','Дракункульоз (Guinea-worm) — паразитарна інфекція (Dracunculus medinensis). Симптоми: свербіж і печіння, болісний пухир (зазвичай на ногах), з якого виходить черв’як; можливі гарячка, нудота.'),(4,'Number_rabies','Rabies','Сказ — смертельна вірусна енцефалітна інфекція (Lyssavirus). Спершу підвищення температури та поколювання у місці укусу, далі – тривога, гідрофобія, спазми м’язів горла, параліч, кома.'),(5,'Number_malaria','Malaria','Малярія — паразитарне захворювання (Plasmodium spp.). Типові симптоми: циклічна лихоманка з ознобом і потом, головний біль, анемія, збільшення селезінки. Важкі форми – органна недостатність.'),(6,'Number_hiv','HIV','ВІЛ-інфекція — ретровірус, що уражає CD4-клітини. На початку – грипоподібний синдром; тривалий безсимптомний період. При прогресуванні (СНІД) — опортуністичні інфекції, схуднення, пухлини.'),(7,'Number_tuberculosis','Tuberculosis','Туберкульоз — бактеріальна інфекція (Mycobacterium tuberculosis). Симптоми: затяжний кашель (часто з кров’ю), нічна пітливість, невмотивована втома, зниження ваги, субфебрилітет.'),(8,'Number_smallpox','Smallpox','Віспа (Smallpox) — вірус Variola (нині ліквідований). Класичні прояви: раптова висока гарячка, головний біль, висип-пустули, що переходять у скоринки та залишають рубці.'),(9,'Number_cholera_cases','Cholera','Холера — гостра діарейна інфекція (Vibrio cholerae). Ключовий симптом: раптовий водянистий пронос “рисовий відвар”, блювання, швидке зневоднення та електролітні порушення.');
/*!40000 ALTER TABLE `diseases` ENABLE KEYS */;
